	Name= Name..CityPreFix[math.random(1,#CityPostFix)]
end
dice= math.random(1,#CityMiddle)
firstHalf=string.sub(CityMiddle[dice],1,#CityMiddle[dice]/2)
dice= math.random(1,#CityMiddle)
secondHalf = string.sub(CityMiddle[dice],#CityMiddle[dice]/2, #CityMiddle)
